How can I implement joi-password-complexity in Joi validation?<p>I want to enforce password complexity by using the joi-password-complexity package when users register.</p>

<p><a href="https://github.com/kamronbatman/joi-password-complexity" rel="nofollow noreferrer">https://github.com/kamronbatman/joi-password-complexity</a></p>

<p>I tried but I got the following error:</p>

<blockquote>
  <p>(node:14872) UnhandledPromiseRejectionWarning: AssertionError
  [ERR_ASSERTION]: Invalid schema content:
  (password.$_root.alternatives)</p>
</blockquote>

<p>This is the code I'm using:</p>

<pre><code>const mongoose = require("mongoose");
const Joi = require("joi");
const passwordComplexity = require("joi-password-complexity");

const complexityOptions = {
  min: 5,
  max: 250,
  lowerCase: 1,
  upperCase: 1,
  numeric: 1,
  symbol: 1,
  requirementCount: 2,
};

const userSchema = new mongoose.Schema({
  name: {
    type: String,
    minlenght: 1,
    maxlength: 55,
    required: true
  },
  email: {
    type: String,
    minlength: 5,
    maxlength: 255,
    unique: true,
    required: true
  },
  password: {
    type: String,
    minlength: 5,
    maxlength: 1024,
    required: true
  }
})

const User = mongoose.model("User", userSchema);

function validateUser(user) {
  const schema = {
    name: Joi.string().min(1).max(55).required(),
    email: Joi.string().min(5).max(255).required().email(),
    password: passwordComplexity(complexityOptions) // This is not working
  }
  return Joi.validate(user, schema);
}

exports.User = User;
exports.validate = validateUser;
</code></pre>

<p>I also tried to follow this example: <a href="https://forum.codewithmosh.com/d/215-joi-password-complexity-problem" rel="nofollow noreferrer">https://forum.codewithmosh.com/d/215-joi-password-complexity-problem</a> but it seems outdated since the "new" keyword will throw another error (not a constructor).</p>

<p>Any help is appreciated!</p>

