Mongoose return average of values grouped by fields in subdocument<p>I'm trying to build a kind of yelp clone using express/mongoose and need to be able to return an object containing the average score for each of the rating categories (for ex: global, location, food, and ambience), each from a different review subdocument. A sample Restaurant would look something like this (I've taken out irrelevant fields):</p>

<pre><code>{ 
  name: 'Test Restaurant',
  reviews: [ 
    { 
      _id: 5e42c12e903eac188077dca5, 
      rating: {
        global: 10,
        location: 5,
        food: 8,
        ambient: 6
        } 
    },
    { 
      _id: 5e42c12e903eac188077dca6, 
      rating: {
        global: 5,
        location: 6,
        food: 4,
        ambient: 2
        } 
    },
    { 
      _id: 5e42c12e903eac188077dca7, 
      rating: {
        global: 9,
        location: 3,
        food: 5,
        ambient: 1
        } 
    },
  ]
}
</code></pre>

<p>So far I've been able to do this using the following virtual, but I imagine this rapidly becoming inefficient if the number of reviews grows big enough:</p>

<pre><code>restaurantSchema.virtual("averageRatings").get(function() {
  const restaurant = this;
  const ratings = restaurant.reviews.map(review =&gt; review.rating);
  const ratingsArrays = {};
  const averageRatings = {};
  const categories = [
    "global",
    "food",
    "ambient",
    "location"
  ];

  //Loop for every category, create new array with the ratings from each review per category, and filter out null ratings
  categories.forEach(category =&gt; {
    ratingsArrays[category] = ratings
      .map(rating =&gt; rating[category])
      .filter(value =&gt; value != null);

  //Calculate average for each category, and return undefined where there are not ratings
    averageRatings[category] =
      ratingsArrays[category].reduce((acc, current) =&gt; acc + current, 0) /
        ratingsArrays[category].length || undefined;
  });
  return averageRatings;
});
</code></pre>

<p>Now, I've seen the more efficient/proper way of doing this is by using the MongoDB aggregation framework, but even though I've looked through the manual and found some very good answers for particular situations, I haven't been able to work through it in this particular case.</p>

<p>Could help me with an approximate pipeline I could work with? Do you know of any resources to learn MongoDB query/aggregation syntax in a friendlier way than the official manuals (Something like this for SQL: <a href="https://sqlbolt.com/" rel="nofollow noreferrer">https://sqlbolt.com/</a>)?</p>

